import * as types from './../constants/ActionTypes.js';

let inititalDefault ='html'; 

const search = (state =inititalDefault ,action) => {
		switch(action.type) {
			case types.CHANGE_SEARCH:
				return action.search
			default:
				return state
		}
}
export default search;
